import React from "react";
import Data from "../example_data.json";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import FiberManualRecordIcon from "@mui/icons-material/FiberManualRecord";
import {CardActionArea} from "@mui/material";
import {flexbox} from "@mui/system";
import {Box} from "@mui/material";

export const PlaceList = () => {
  const test = (value) => {
    // console.log(`Value`);
    // console.log(value);

    console.log(
      value.map((item) => {
        item.time_open;
      })
    );
  };
  const Time = (time) => {
    test(time.filter((item) => item.day === "Monday"));

    //return items.filter((item) => item.day === "Monday");
    //return console.log(item.operation_time);
    // return console.log(time.filter((item) => item.day === "Monday"));
  };
  // item.operation_time.filter((dates) => dates.day === "Monday");

  const info = Data.map((item) => (
    <Card
      key={item.id}
      sx={{
        bgcolor: "background.paper",
        m: 1,
        border: 1,
        borderColor: "primary.main",
        width: "10",
      }}>
      <CardHeader
        avatar={
          <Avatar src={item.profile_image_url} variant="rounded">
            {" "}
            {item.id}
          </Avatar>
        }
        action={<FiberManualRecordIcon />}
        title={item.name}
        subheader={Time(item.operation_time)}
        // subheader={`${item.operation_time[0]["time_open"]} - ${item.operation_time[0]["time_close"]}`}
      />
      <CardMedia
        component="img"
        height="194"
        image="/static/images/cards/paella.jpg"
        alt="Paella dish"
      />
    </Card>
  ));

  return <>{info}</>;
};
